import {
  bumps_default
} from "./chunk-HWFVKXTZ.js";
import {
  init_esm_shims
} from "./chunk-WWCIODDN.js";

// Commands/General/bumps.ts
init_esm_shims();
import { SlashCommandBuilder, EmbedBuilder, Colors } from "discord.js";
var command = {
  data: new SlashCommandBuilder().setName("bumps").setDescription("Sehe, wie oft du schon gebumpt hast"),
  async execute(interaction, client) {
    const embed = new EmbedBuilder({
      color: Colors.Gold,
      description: ""
    });
    await bumps_default.findOne({ userId: interaction.user.id }).then((User) => {
      embed.data.description = `Du hast bisher ${User?.bumps || 0} mal gebumpt`;
    });
    interaction.reply({ embeds: [embed], ephemeral: true });
  }
};
var bumps_default2 = command;
export {
  bumps_default2 as default
};
